import React from 'react';
//Styles
import './Team.css';
//Component
import Header from '../Header/Header';
//Data
import { STAFF } from '../../shared/staff';



const staffCard = ({element}) => (
    <div className="staff__card">
        {/* <img>{element.image}</img> */}
        <h2> {element.name}</h2>
        <h4>{element.description}</h4>
    </div>
);



const Team = () => {
    const staffs = STAFF;
    const renderStaffs = (elements) => elements.map(element => staffCard(element));
    const staffCards = renderStaffs(staffs)

    return (
        <div>
            <Header color={'var(--DarkNavy)'} barColor={'var(--Blue)'} />
            <div className="staff_grid">
                {staffCards}
            </div>
        </div>
    );
}

export default Team;
